  [],\n\t\"num_tags\": 0,\n\t\"name\": \"physical-chemical-and-meteorological-data-from-ctd-and-other-instruments-from-wave-gliders-in-t\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This dataset was generated by a group of
  4 Wave Gliders, referred to as Papa Mau, Benjamin, Piccard Maru, and Fontaine Maru.
  The vehicles were launched from San Francisco in November of 2011. All 4 traveled
  together to Hawaii, at which point, they were recovered, serviced, and returned
  to the water to continue the mission. After servicing in Hawaii, Papa Mau and Benjamin
  were destined for Australia, while Piccard Maru and Fontaine Maru were destined
  for Japan. Each vehicle had an identical sensor suite consisting of a SeaBird Electronics
  GPCTD with dissolved oxygen, an Airmar PB200 weather station, a Turner Designs C3
  fluorometer, and a Datawell MOSE-G wave sensor. The two Wave Gliders destined for
  Japan experienced technical difficulties. Fontaine Maru was rescued by the R/V Kilo
  Moana about a quarter of the way to Japan, while Piccard Maru continues to drift
  in the North Pacific, periodically continuing to communicate. Papa Mau and Benjamin
  both reached their destination of Australia. While Papa Mau traveled the leg from
  Hawaii to Australia uninterrupted, Benjamin was serviced in Samoa.\",\n\t\"owner_org\":
